    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Laguna Atascosa NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Laguna Atascosa NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, information about the management direction, and strategies for implementation
    and monitoring. Key planning issues include: wildlife management, habitat management,
    visitor services, land protection, cultural resources, wetland management, and threatened
    and endangered species.",nt"license_title": "License Not Specified",nt"extras":
